// src/api.ts (or api.js)
const API = (path = "") => `http://localhost:8000${path}`;

// Flexible hours: "10m", "24h", "7d", "0.5", etc.
export async function getKPIs(hours = "7d") {
  const res = await fetch(API(`/kpis?hours=${encodeURIComponent(hours)}`));
  if (!res.ok) throw new Error(`KPIs fetch failed: ${res.status}`);
  return res.json() as Promise<{
    avg_people: number;
    peak_people: number;
    throughput: number;
    hours: number;
  }>;
}

export type SeriesPoint = {
  timestamp: string;     // "YYYY-MM-DDTHH"
  count_value: number;   // hourly average (use this for the line)
  peak: number;
  throughput: number;
};

// Minimal CSV parser tailored to /series.csv
export async function getSeries(hours = "7d"): Promise<SeriesPoint[]> {
  const res = await fetch(API(`/series.csv?hours=${encodeURIComponent(hours)}`));
  if (!res.ok) throw new Error(`Series fetch failed: ${res.status}`);
  const text = (await res.text()).trim();
  const lines = text.split(/\r?\n/);
  if (lines.length <= 1) return [];
  return lines.slice(1).map((line) => {
    const [timestamp, count_value, peak, throughput] = line.split(",");
    return {
      timestamp,
      count_value: Number(count_value),
      peak: Number(peak),
      throughput: Number(throughput),
    };
  });
}

// ---------------------------------------------------------------------------
// Example React component that uses the new keys
// ---------------------------------------------------------------------------
// Place this wherever you render your chart (e.g., src/components/Dashboard.tsx)

import React from "react";
import { getSeries, getKPIs, SeriesPoint } from "./api";
import {
  LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer,
} from "recharts";

export default function Dashboard() {
  const [hours, setHours] = React.useState<string>("7d");
  const [series, setSeries] = React.useState<SeriesPoint[]>([]);
  const [kpis, setKpis] = React.useState<{avg_people:number;peak_people:number;throughput:number;hours:number} | null>(null);
  const [loading, setLoading] = React.useState(false);
  const [error, setError] = React.useState<string | null>(null);

  const load = React.useCallback(async () => {
    setLoading(true); setError(null);
    try {
      const [s, k] = await Promise.all([getSeries(hours), getKPIs(hours)]);
      setSeries(s); setKpis(k);
    } catch (e:any) {
      setError(e?.message ?? "Failed to load");
    } finally {
      setLoading(false);
    }
  }, [hours]);

  React.useEffect(() => { load(); }, [load]);

  return (
    <div className="p-4 space-y-4">
      <div className="flex items-center gap-2">
        <label className="text-sm opacity-80">Window:</label>
        <select
          className="border rounded px-2 py-1"
          value={hours}
          onChange={(e) => setHours(e.target.value)}
        >
          <option value="10m">10m</option>
          <option value="24h">24h</option>
          <option value="7d">7d</option>
          <option value="30d">30d</option>
        </select>
        <button className="border rounded px-2 py-1" onClick={load}>Refresh</button>
        <button
          className="border rounded px-2 py-1"
          onClick={() => fetch("http://localhost:8000/seed_demo", { method: "POST" }).then(load)}
        >
          Seed demo
        </button>
      </div>

      {kpis && (
        <div className="grid grid-cols-3 gap-3 text-sm">
          <div className="border rounded p-3">
            <div className="opacity-60">Avg People</div>
            <div className="text-xl font-semibold">{kpis.avg_people}</div>
          </div>
          <div className="border rounded p-3">
            <div className="opacity-60">Peak People</div>
            <div className="text-xl font-semibold">{kpis.peak_people}</div>
          </div>
          <div className="border rounded p-3">
            <div className="opacity-60">Throughput</div>
            <div className="text-xl font-semibold">{kpis.throughput}</div>
          </div>
        </div>
      )}

      {error && <div className="text-red-600">{error}</div>}
      {loading && <div className="opacity-70">Loadingâ€¦</div>}

      <div style={{ width: "100%", height: 320 }}>
        <ResponsiveContainer>
          <LineChart data={series}>
            <CartesianGrid strokeDasharray="3 3" />
            <XAxis
              dataKey="timestamp"
              tickFormatter={(t) => t.slice(11, 13) + ":00"} // show hour
              minTickGap={16}
            />
            <YAxis />
            <Tooltip />
            {/* IMPORTANT: use dataKey="count_value" to match the CSV */}
            <Line type="monotone" dataKey="count_value" dot={false} />
          </LineChart>
        </ResponsiveContainer>
      </div>
    </div>
  );
}

